import React, { useContext } from 'react'
import HeaderOfPage from '../components/DetailPageComponents/header/HeaderOfPage'
import '../styles/DetailPage/header.css'
import {Context} from '../context/detailHandler'


const ProductsDetail = () => {
    // const { values } = useContext(Context)
    // console.log(values.sum, values.count)
    return (
        <Context.Consumer>
        {(props) => {
            return <HeaderOfPage count={props.count} sum={props.sum} />
        }}
            <div className="container">
            </div>
        </Context.Consumer>
    )
}

export default ProductsDetail;
